profile_positions.description:
Advising Mid-Market and Enterprise segment customers on their Plan – Market - Hire - Develop -Strategy.

Core responsibilities:
		○ Grow contracts, run pilots, and generate new business;
		○ Meetings with C-Suite to determine strategy and presenting data analysis;
		○ Collaboration with business partners to ensure contract growth or prevent churn;
		○ Cross sell and lead share with other Business Lines;
		○ Territory Planning (create short, mid and long term growth strategies) and accurate  
                     forecasting;
		○ Implement right solutions aligned with the objectives of the customer;
		○ Managing end to end sales process;
		○ Coaching new hires and coachees on their strategy and performance;

Achievements:
FY20: awarded Sales Rep EMEA most MYD’s sold
FY20: overachievement: H1:102% and H2:120%
FY21: overachievement: H1:144% and H2:133%
FY21: LinkedIn President Club winner (including 126% start COVID-19 Quarter)
FY22: awarded highest performing Account Director Benelux 
FY22: overachievement: Q1:131% and Q2:121%
